const CartItem = () => {
  return (
    <div style={{ borderBottom: '1px solid #ddd', padding: '10px 0' }}>
      <p>Product Name</p>
      <p>Quantity: 1</p>
      <p>Price: $10</p>
      <button>Remove</button>
    </div>
  );
};

export default CartItem;
